		double temp1 = ((rq1_s*rq5_s + rq5_c*(rq4_c*(rq1_c*rq2_s*rq3_s - rq1_c*rq2_c*rq3_c) + rq4_s*(rq1_c*rq2_c*rq3_s + rq1_c*rq3_c*rq2_s)))*(lq1_s*lq5_s - lq5_c*(lq4_c*(lq1_c*lq2_c*lq3_c - lq1_c*lq2_s*lq3_s) - lq4_s*(lq1_c*lq2_c*lq3_s + lq1_c*lq3_c*lq2_s))) + (rq5_c*(rq4_c*(rq3_c*(rq0_s*rq2_s - rq0_c*rq2_c*rq1_s) + rq3_s*(rq2_c*rq0_s + rq0_c*rq1_s*rq2_s)) + rq4_s*(rq3_c*(rq2_c*rq0_s + rq0_c*rq1_s*rq2_s) - rq3_s*(rq0_s*rq2_s - rq0_c*rq2_c*rq1_s))) - rq0_c*rq1_c*rq5_s)*(lq5_c*(lq4_c*(lq3_c*(lq0_s*lq2_s - lq0_c*lq2_c*lq1_s) + lq3_s*(lq2_c*lq0_s + lq0_c*lq1_s*lq2_s)) + lq4_s*(lq3_c*(lq2_c*lq0_s + lq0_c*lq1_s*lq2_s) - lq3_s*(lq0_s*lq2_s - lq0_c*lq2_c*lq1_s))) - lq0_c*lq1_c*lq5_s) + (rq5_c*(rq4_c*(rq3_c*(rq0_c*rq2_s + rq2_c*rq0_s*rq1_s) + rq3_s*(rq0_c*rq2_c - rq0_s*rq1_s*rq2_s)) + rq4_s*(rq3_c*(rq0_c*rq2_c - rq0_s*rq1_s*rq2_s) - rq3_s*(rq0_c*rq2_s + rq2_c*rq0_s*rq1_s))) + rq1_c*rq0_s*rq5_s)*(lq5_c*(lq4_c*(lq3_c*(lq0_c*lq2_s + lq2_c*lq0_s*lq1_s) + lq3_s*(lq0_c*lq2_c - lq0_s*lq1_s*lq2_s)) + lq4_s*(lq3_c*(lq0_c*lq2_c - lq0_s*lq1_s*lq2_s) - lq3_s*(lq0_c*lq2_s + lq2_c*lq0_s*lq1_s))) + lq1_c*lq0_s*lq5_s));
		double temp2 = ((rq5_c*(rq4_c*(rq3_c*(rq0_s*rq2_s - rq0_c*rq2_c*rq1_s) + rq3_s*(rq2_c*rq0_s + rq0_c*rq1_s*rq2_s)) + rq4_s*(rq3_c*(rq2_c*rq0_s + rq0_c*rq1_s*rq2_s) - rq3_s*(rq0_s*rq2_s - rq0_c*rq2_c*rq1_s))) - rq0_c*rq1_c*rq5_s)*(lq4_c*(lq3_c*(lq2_c*lq0_s + lq0_c*lq1_s*lq2_s) - lq3_s*(lq0_s*lq2_s - lq0_c*lq2_c*lq1_s)) - lq4_s*(lq3_c*(lq0_s*lq2_s - lq0_c*lq2_c*lq1_s) + lq3_s*(lq2_c*lq0_s + lq0_c*lq1_s*lq2_s))) + (rq5_c*(rq4_c*(rq3_c*(rq0_c*rq2_s + rq2_c*rq0_s*rq1_s) + rq3_s*(rq0_c*rq2_c - rq0_s*rq1_s*rq2_s)) + rq4_s*(rq3_c*(rq0_c*rq2_c - rq0_s*rq1_s*rq2_s) - rq3_s*(rq0_c*rq2_s + rq2_c*rq0_s*rq1_s))) + rq1_c*rq0_s*rq5_s)*(lq4_c*(lq3_c*(lq0_c*lq2_c - lq0_s*lq1_s*lq2_s) - lq3_s*(lq0_c*lq2_s + lq2_c*lq0_s*lq1_s)) - lq4_s*(lq3_c*(lq0_c*lq2_s + lq2_c*lq0_s*lq1_s) + lq3_s*(lq0_c*lq2_c - lq0_s*lq1_s*lq2_s))) + (lq4_c*(lq1_c*lq2_c*lq3_s + lq1_c*lq3_c*lq2_s) + lq4_s*(lq1_c*lq2_c*lq3_c - lq1_c*lq2_s*lq3_s))*(rq1_s*rq5_s + rq5_c*(rq4_c*(rq1_c*rq2_s*rq3_s - rq1_c*rq2_c*rq3_c) + rq4_s*(rq1_c*rq2_c*rq3_s + rq1_c*rq3_c*rq2_s))));
