		double temp4 = ((rq4_c*(rq3_c*(rq2_c*rq0_s + rq0_c*rq1_s*rq2_s) - rq3_s*(rq0_s*rq2_s - rq0_c*rq2_c*rq1_s)) - rq4_s*(rq3_c*(rq0_s*rq2_s - rq0_c*rq2_c*rq1_s) + rq3_s*(rq2_c*rq0_s + rq0_c*rq1_s*rq2_s)))*(lq4_c*(lq3_c*(lq2_c*lq0_s + lq0_c*lq1_s*lq2_s) - lq3_s*(lq0_s*lq2_s - lq0_c*lq2_c*lq1_s)) - lq4_s*(lq3_c*(lq0_s*lq2_s - lq0_c*lq2_c*lq1_s) + lq3_s*(lq2_c*lq0_s + lq0_c*lq1_s*lq2_s))) + (rq4_c*(rq3_c*(rq0_c*rq2_c - rq0_s*rq1_s*rq2_s) - rq3_s*(rq0_c*rq2_s + rq2_c*rq0_s*rq1_s)) - rq4_s*(rq3_c*(rq0_c*rq2_s + rq2_c*rq0_s*rq1_s) + rq3_s*(rq0_c*rq2_c - rq0_s*rq1_s*rq2_s)))*(lq4_c*(lq3_c*(lq0_c*lq2_c - lq0_s*lq1_s*lq2_s) - lq3_s*(lq0_c*lq2_s + lq2_c*lq0_s*lq1_s)) - lq4_s*(lq3_c*(lq0_c*lq2_s + lq2_c*lq0_s*lq1_s) + lq3_s*(lq0_c*lq2_c - lq0_s*lq1_s*lq2_s))) + (lq4_c*(lq1_c*lq2_c*lq3_s + lq1_c*lq3_c*lq2_s) + lq4_s*(lq1_c*lq2_c*lq3_c - lq1_c*lq2_s*lq3_s))*(rq4_c*(rq1_c*rq2_c*rq3_s + rq1_c*rq3_c*rq2_s) - rq4_s*(rq1_c*rq2_s*rq3_s - rq1_c*rq2_c*rq3_c)));
